import React, { useContext } from 'react'
import { Link } from 'react-router-dom';
import { UserContext } from '../../UserContext'
const Home = () => {
    const {user,setuser}=useContext(UserContext);
    const setjohn=()=>{
        const obj={
            name:"john",
            email:"john@gmail.com",
            password:"123",
            id:"345"
        }
        setuser(obj)
    }
    const setTom=()=>{
        const obj={
            name:"tom",
            email:"tom@gmail.com",
            password:"456",
            id:"468"
        }
        setuser(obj)
    }
    return (
        <div>
            <h1>Home {JSON.stringify(user)} </h1>
            <button onClick={()=>setjohn} >Set as john</button>
            <button onClick={()=>setTom} >Set as tom</button>
        <Link to="/chat">
         <button>Goto chat</button>
        </Link>
        </div>
    )
}

export default Home
